         rA4 = pA0[158];
         rC0_0 += m0;
         m0 = rA3 * rB0;
         rA5 = pA0[190];
         rC1_0 += m1;
         m1 = rA4 * rB0;
         rC2_0 += m2;
         m2 = rA5 * rB0;
         rA0 = pA0[31];
         rB0 = pB0[31];
         rA1 = pA0[63];
         rC3_0 += m0;
         m0 = rA0 * rB0;
         rA2 = pA0[95];
         rC4_0 += m1;
         m1 = rA1 * rB0;
         rA3 = pA0[127];
         rC5_0 += m2;
         m2 = rA2 * rB0;
         rA4 = pA0[159];
